import ExpenseItem from "./components/ExpenseItem";

function App() {

  const expenses = [
    { title: "Car Insurance", amount: 234, date: new Date(2021, 9, 23) },
    { title: "Car Insurance", amount: 234, date: new Date(2021, 9, 23) },
    { title: "Car Insurance", amount: 234, date: new Date(2021, 9, 23) },
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      {expenses.map(e =>
        <ExpenseItem title={e.title}
          amount={e.amount}
          date={e.date} />)
      }
    </div>
  );
}

export default App;
